description:
Anyone with any interest in contemporary Australian Aboriginal culture should have a look at this film.

Directed by Ivan Sen

Beneath Clouds tells the story of Lena, the daughter of an Aboriginal mother and an Irish father and Vaughn, a Murri boy who is doing time in a minimum security prison in North West NSW. Dramatic events throw them together and with no money or transport, they find themselves relying on each other in order to achieve their personal journeys. 
